import React from "react";
import Login from "./components/Login";
import Register from "./components/Register";
import PostList from "./components/PostList";

const HomePage = () => {
  return (
    <div>
      <div id="home">A
        <HomePage />
      </div>

      <div id="login">
        <Login />
      </div>

      <div id="register">
        <Register />
      </div>

      <div id="posts">
        <PostList />
      </div>
    </div>
  );
};

export default HomePage;
